import React from 'react'
import '../tailwind.output.css'
import { useForm } from 'react-hook-form'

type Inputs = {
  username: string
  fullname: string
  email: string
  password: string
}

export const Register = () => {
  const { register, handleSubmit, errors } = useForm<Inputs>()
  const onSubmit = (data: Inputs) => {
    console.log('data', data)
  }

  return (
    <form onSubmit={handleSubmit(onSubmit)}>
      <input type="text" id="fullname" name="fullname" ref={register({ required: true })} />
      {errors.fullname && errors.fullname.type === 'required' && <div className="error">You must enter your name.</div>}
      <input type="email" id="email" name="email" ref={register({ required: true })} />
      {errors.email && errors.email.type === 'required' && <div className="error">You must enter your email address.</div>}
      <input type="submit" />
    </form>
  )
}
